const defaultState = {
    state: "сетка"
}

export const positionReduser = (state, action) => {
    switch (action.type) {
        case "CHANGE_POSITION":
          return {...state, position: state.position + action.payload};
        case "SET_COUNT":
          return {...state, position: 0 + action.payload};
        default:
          return state;
    }
}
